import Title from "./Title";
import logo from '../public/logo.jpg'
import './Banner.css'

function Banner() {
    return (
        <div>
            <div className='voting-banner'>
                <img src={logo} alt='logo' className='voting-logo' />
            </div>
            <Title />
        </div>
    )
}

export default Banner
